import Image from 'next/image'

function Home() {
    return (
        <>
            <h1>My Homepage</h1>
            <Image
                src="/img/author.png"
                alt="Picture of the author"
                width={100}
                height={100}
            />
            <p>Welcome to my homepage!</p>
        </>
    )
}

export default Home
